import React from 'react';
import {useForm} from 'react-hook-form';
import { Link } from 'react-router-dom';
import { useState } from 'react';
import './sign-up.css'

//find out cum sa fac sa tin minte in acel obiect si token si sa salvez toate astea in Useri
//de pus o functie de inregistrat datele pe butonu de submit?

export default function SignUp(){
  const {register, handleSubmit, formState: {errors}} = useForm();
  const onSubmit = data => console.log(data);
  console.log(errors);

  const [name, setName] = useState('');

  return (
    <div className='sign-up'>
      <h1 id='sign-up-title' >Sign Up</h1>

      <form onSubmit={handleSubmit(onSubmit)}>
        <label htmlFor="name">Name: </label>
        <input id='name' className='input-item' type="text" placeholder='Name' {...register('Name', {required:true, maxLength:80})}/>

        <label htmlFor="username">Username: </label>
        <input id='username' className='input-item' type="text" placeholder='Username' {...register('Username', {required:true, maxLength:80})} />

        <label htmlFor="password">Password: </label>
        <input id='password' className='input-item' type="password" placeholder='Password' {...register('Password', {required:true, maxLength:9})} />
        
        <p id='p-item'><small>The password requires a max of 8 characters.</small></p>

        <button id='create-btn' type='submit'>Create an account</button>

        <p>
          <Link to='../sign-in'>Already have an account? Click here to sign in!</Link>
        </p>
      </form>
    </div>
  )
}
